export type CardSection3Props={

  AreaChartData?:any
  BarChartData?:any
  RadarChartData?:any
  graphData?:any
}


const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);


const CardSection3 = (props: CardSection3Props)=>{
  const getcardsec3 = () =>{
    const coutput:any = [];
    Array.isArray(props?.graphData) && props?.graphData.forEach(items=>{
      coutput.push(
        <Row>
        <Col md={8} sm={12}>
          <Card  ><div style={{height:"500px"}}>
      <RadarChart
      RadarChartData={items?.graphData.cardsection3.radarchart}
      />

            </div></Card>
        </Col>
   </Row>

      )
    });
    return coutput;
  }

return (
  <div>

     {getcardsec3()}
  </div>


)

}













